import { PostCard } from '../PostCard/';
import './styles.css'
export const Posts = ({posts, page}) => {
    <div className='posts'>
        {posts.map(post => (
          <PostCard 
          key={post.id}
          title={post.title} 
          body={post.body}
          id={post.id}
          cover={post.cover}
          />
        ))}
    </div>
}
